let Form = () => {
    const [text, setText] = useState()

    useEffect((event) => {
        setText()
    })

    return (
        <div className = 'form'>
            <input className = 'cardNumber' value = {text} type = 'text' placeholder = 'Card number'/>
            <input className = 'cardDate' type = 'text' placeholder = 'Date'/>
            <input className = 'cardCVV' type = 'text' placeholder = 'CVV2'/>
        </div>
    )
}

export default Form
